import React, { Component } from 'react';
import data from "./data"; 

const feed = data.activities;

class Activity extends Component {
	render() {
		return (
            <ul>
                {feed.map((f) => {
                    return f.person.map((p) => {
                        return <li>{p.name}: {f.action}</li>
                    }
                )})}
            </ul>
        );
    }
} 
export default Activity;
